description:
Researching and planning a holiday:
- reasons for going on holiday in 2013;
- respondents’ motivation to return to the same place for holidays;
- most used sources of information for planning a holiday;
- how respondents arranged their holidays in 2013;
Type of holiday experience: travellers' profile, satisfaction, methods of complaint, others.
#####The results by volumes are distributed as follows:
* Volume A: Countries
* Volume AA: Groups of countries
* Volume A' (AP): Trends
* Volume AA' (AAP): Trends of groups of countries
* Volume B: EU/socio-demographics
* Volume C: Country/socio-demographics
